import React from "react";

import "./SignUp.css";

const Register = () => {
  return (
    <form className="signUpContainer">
      <label>이메일</label>
      <input type="email" name="userEmail" className="input_signup"/>
      <label>비밀번호</label>
      <input type="password" name="userPassword" className="input_signup" />
      <label>닉네임</label>
      <input type="nickname" name="userNickname"className="input_signup" />
      <button type="submit">가입하기</button>
    </form>
  );
};

export default Register;
